import { motion } from "framer-motion"
import estyle from "./MainNav.module.scss"
import { Link } from "react-router-dom"
import { useState, useContext, useEffect } from "react"
import NavContext from '../../NavContext'

function MainNav({props}) {
    const menudisabledamount = props.disablemenuamount * 1000
    const [enablebutton, setEnableButton] = useState(true)
    const [isPrevActive, setPrevActive] = useState('')
    const [isActive, setActive] = useState('about');
    let firsttime = true;
    const { changenav } = useContext(NavContext)
    const navlabels = ["ABOUT", "PROJECTS", "CLIENTS", "PARTNERS", "FUTURE", "CONTACT"]
    const thenav = []


    //need to figure out how to animate the unclicked nav item back to it's original colour. right now it just flips back.

    const handleHoverVariant = {
        fromselected: {color: '#03FFFA'}, /* teal */
        tounselected: { color:'#292728',  /* charcoal */ 
            transition: { 
                color:{ duration: 2 }
            }
        },
        fromunselected: { color:'#292728' }, /* charcoal */ 
        toselected: {color: '#03FFFA',  /* teal */
            transition: { 
                color:{ duration: 2 }
            }
        },
        hoveranim: {
            color:props.hovercolor, /* charcoal */ 
            transition:{ duration:props.hoveranimduration }
        }
    }

    const handleClick = (e, waittime, label) => {

        if(isActive != label)
        {
            setEnableButton(false)

            setTimeout(() => {        
                setEnableButton(true)
            }, menudisabledamount)

            // setTimeout(() => {        
            //     setPrevActive('')
            // }, 3000)

            console.log('isActive is: ' + isActive)
            console.log('isPrevActive is: ' + isPrevActive)
            console.log('-----')
            setPrevActive(isActive)

            console.log('label is: ' + label)
            setActive(label);
            console.log('setActive has been set to the label')
            console.log('-----')
            console.log('isActive is now: ' + isActive)
            console.log('isPrevActive is now: ' + isPrevActive)
            changenav(e.target.childNodes[0].data.toLowerCase(), waittime)
        }
    }

    useEffect(() => {

        console.log('useEffect - isPrevActive has changed to: ' + isPrevActive)
        console.log('useEffect - isActive has changed to: ' + isActive)
        let blah = 0;

        if(firsttime == true){
            console.log('firsttime is ' + firsttime)
            firsttime = false;
        }
        else
        {
            console.log('useeffect - else -  ' + firsttime)
            console.log('firsttime is ' + firsttime)
            setTimeout(() => {        
                setPrevActive('')
                console.log('counting to 3 - ' + blah++)
            }, 3000)
            // setTimeout(() => {        
            //     setActive(label)
            //     console.log('counting to 3 - ' + blah++)
            // }, 3000)

            setTimeout(() => {
                console.log('isPrevActive is: ' + isPrevActive)
            }, 3000)
        }


    }, [isPrevActive])

    for(let i = 0; i < navlabels.length; i++) {
        thenav.push(
            <motion.li key={i} className={estyle.mainnavbtn}
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ delay:props.delay + (i*.2), duration: props.duration }}
            >
                {enablebutton ?
                    <Link className={`${estyle.link} ${navlabels[i].toLowerCase()} ${(isActive === navlabels[i].toLowerCase() ? null : estyle.selected)}`} to={`/${navlabels[i]}`.toLowerCase()} onClick={(e) => handleClick(e, props.sectiondelay, navlabels[i].toLowerCase())}>

                        {/* 
                            need to set up another tenery for the initial load, so that about starts teal
                        */}

                        {isPrevActive === navlabels[i].toLowerCase() ?
                        <motion.div 
                            className={estyle.link}
                            variants={handleHoverVariant}
                            initial="fromselected"
                            animate="tounselected"
                            whileHover={isActive === navlabels[i].toLowerCase() ? "startanim" : "hoveranim"}
                        >
                        P=L<br/>{navlabels[i]}
                        </motion.div> :
                        <motion.div
                            className={`${estyle.link} ${(isActive === navlabels[i].toLowerCase() ? estyle.selected : null)}`}
                            variants={handleHoverVariant}
                            initial={isActive === navlabels[i].toLowerCase() ? "fromunselected" : null }
                            // animate={isActive === navlabels[i].toLowerCase() ? "toselected" : null }
                            // whileHover={isActive === navlabels[i].toLowerCase() ? "startanim" : "hoveranim"}
                            whileHover={"hoveranim"}

                        >
                            P!=L<br/>{navlabels[i]}
                        </motion.div> 
                        }
                    </Link> :
                    <div className={`${estyle.link} ${(isPrevActive === navlabels[i].toLowerCase() ? estyle.selected : null)} `}>{navlabels[i]}</div>
                }
            </motion.li>
        )
    }

    return (
        <nav>
            <ul className={estyle.mainnav}>
                {thenav}
            </ul>
        </nav>
    )
}
export default MainNav;
